import logo from './logo.svg';
import './App.css';


const list = [
  {
    title: 'React',
    url: 'https://reactjs.org/',
    author: 'Jordan Walke',
    num_comments: 3,
    points: 4,
    objectID: 0,
  },
  {
    title: 'Redux',
    url: 'https://redux.js.org/',
    author: 'Dan Abramov, Andrew Clark',
    num_comments: 2,
    points: 5,
    objectID: 1,
  },
];

function App() {

  return (
    <div className="d">
      {
        list.map(function(i){
          return(
            <div key={i.objectID}> 
              <h1>{i.title}</h1> 
              <a href={i.url}>{url}</a>

            </div>
            )
        })
      }
    </div>

  );
}

export default App;
